import './index.css';
import 'bootstrap/dist/css/bootstrap.min.css'; 
import { CKEditor } from 'ckeditor4-react';
import Header from './Header';

function Post() {
  return (
    <div class="post">
      <Header></Header>

      <div class='form-wrapper'>
        <input class="title-input" type='text' placeholder='Title' />
        <CKEditor/>
      </div>
      <button class="btn btn-post bg-dark btn-outline-light btn-lg px-5 text-white ">Go to Question!</button>
     </div>

  );
}

export default Post;
